import { Title } from "../styled";
import { StyledRenopwacja } from "./styled";

export const Renowacja = () => {
  return (
    <StyledRenopwacja>
      <Title>
        Renowacja Felg w Żyrardowie i okolicach – Piaskowanie, Malowanie Proszkowe, Naprawa
        i Odtwarzanie Zniszczonych Felg
      </Title>
     
  <div>
  Specjalizujemy się w kompleksowej renowacji felg – realizujemy zlecenia z <strong>całej Polski</strong>, ale działamy przede wszystkim lokalnie w <strong>Żyrardowie i okolicach</strong>. Przywracamy nawet bardzo zniszczone felgi do fabrycznego wyglądu i pełnej sprawności.

  Wykonujemy piaskowanie strumieniowo-ścierne, malowanie proszkowe, prostowanie na maszynach CNC, spawanie pęknięć i odtwarzanie oryginalnego kształtu felgi. Każdy etap naprawy kontrolujemy pod kątem bezpieczeństwa i jakości. Zapewniamy szybkie terminy, atrakcyjne ceny i fachowe doradztwo.
</div>
    </StyledRenopwacja>
  );
};
